function setMaxTxnAmount(uint256 newNum) external onlyOwner {
        require(
            newNum >= ((totalSupply() * 5) / 1000) / 1e18,
            "Cannot change maxTransactionAmount lower than 0.2%"
        );
        maxTransactionAmount = newNum * (10**18);
    }
